import React, { Component } from 'react'

export default class FriendCards extends Component {
    render() {
        const user = this.props.singleuser;
        return (
            <div class="card w-50 p-3">
                <div class="card-footer">
                    <div className="createfooter">
                        <div className="footer pd-2"> <img className="round-img" src="/images/bean.jpg" alt="Avatar" />{user.firstName} {user.surName}</div>
                        <div className="footer"> <button type="button" class="btn">{user.status}</button></div>
                        <div><button type="button" class="btn">Delete</button></div>
                    </div>
                </div>
            </div>
        )
    }
}
